import MyPosts from './MyPosts/MyPosts'
import Dialog from "../Dialogs/Dialog/Dialog";
const Cont = (props) => {
    return (
        <ul>
            <MyPosts newPostText = {props.newPostText}
                     addPost={props.addPost}
                     updatePost={props.updatePost}
                     contentsPosts={props.contentsMP}/>
        </ul>
    )
}

export default Cont;
